package guerer.example;

import static org.junit.Assert.*;

import org.junit.Test;

public class PalindromePartitioningII132Test {

	@Test
	public void test() {
		PalindromePartitioningII132 pp = new PalindromePartitioningII132();

		assertEquals(1, pp.minCut("aab"));
		assertEquals(0, pp.minCut("fff"));
		assertEquals(89, pp.minCut("kwtbjmsjvbrwriqwxadwnufplszhqccayvdhhvscxjaqsrmrrqngmuvxnugdzjfxeihogzsdjtvdmkudckjoggltcuybddbjoizu"));
		assertEquals(1, pp.minCut(
				""));
	}

}
